import Layout from '../components/Layout';

const User = () => (
    <Layout title="register page">
    <div>
        <h1>This is the User Page</h1>
        <p>This is where the user should sign into the website.</p>
        <form>
            <input placeholder="Input Username"></input>
        </form>
    </div>
    </Layout>
);

export default User;
